import React from "react";
import styles from "./TldCategoryList.module.css";

export default function TldCategoryList() {
  return (
    <div className={styles.container}>
      <div className={styles.categoryItem}>
        <h3>Top Picks</h3>
      </div>
      <div className={styles.categoryItem}>
        <h3>Two Letter</h3>
      </div>
      <div className={styles.categoryItem}>
        <h3>Three Letter</h3>
      </div>
      <div className={styles.categoryItem}>
        <h3>Emojis</h3>
      </div>
      <div className={styles.categoryItem}>
        <h3>Names</h3>
      </div>
    </div>
  );
}
